import { Button, TextField } from "@mui/material";
import "./homepage.css";
import axios from "axios";

export default function Homepage() {
  const handleSubmit = async () => {
    // armar url
    const url = `http://localhost:8080/api/mercadolibre?ram=8&inches=15&storage=256&minPrice=600000&maxPrice=800000&sort=desc`;

    try {
      const data = await axios.get(url);
      console.log(data.data);
    } catch (e) {
      //
    }
  };

  return (
    <div className="container">
      <h1 className="title">Web Scraper</h1>
      <div className="inputs-container">
        {/* First Row */}
        <div className="input-row">
          <div className="input-item">
            <span className="label">Max Price</span>
            <TextField variant="filled" className="textfield" />
          </div>

          <div className="input-item">
            <span className="label">Min Price</span>
            <TextField variant="filled" className="textfield" />
          </div>

          <div className="input-item">
            <span className="label">Ammount</span>
            <TextField variant="filled" className="textfield" />
          </div>

          <div className="input-item">
            <span className="label">Sort</span>
            <TextField variant="filled" className="textfield" />
          </div>
        </div>

        {/* Second Row */}
        <div className="input-row">
          <div className="input-item">
            <span className="label">Ram</span>
            <TextField variant="filled" className="textfield" />
          </div>

          <div className="input-item">
            <span className="label">Screen Size</span>
            <TextField variant="filled" className="textfield" />
          </div>

          <div className="input-item">
            <span className="label">Storage</span>
            <TextField variant="filled" className="textfield" />
          </div>

          <div className="input-item">
            <span className="label">Processor</span>
            <TextField variant="filled" className="textfield" />
          </div>
        </div>
      </div>
      <Button variant="contained" onClick={handleSubmit}>
        Submit
      </Button>
    </div>
  );
}
